import Layout from "./layout";

const Page = ({ seo, children, hero }) => {
  return (
    <Layout>
      <Seo seo={seo} />
      {hero}
      <SimpleGrid columns="2" spacing={8} m="0" p="8" bg="gray.light">
        {Children}
      </SimpleGrid>
    </Layout>
  );
};

export default page;
